import React from 'react';
import { Link } from 'react-router-dom';
import '../css/user_type.css';
import { clickHandlerEmployer } from '../utils/employer_handler';
import { clickHandlerEmployee } from '../utils/employee_handler';


function UserType() {
  return (
    <React.Fragment>
      <div className='user-type'>
        <div>
            <Link to='/sign_up_employer'><h1 onClick={(clickHandlerEmployer)}>Sign Up As An Employer</h1></Link>
        </div>
        <div>
            <Link to='/sign_up_employee'><h1 onClick={(clickHandlerEmployee)}>Sign Up As A job Seeker</h1></Link>
        </div>
      </div>
    </React.Fragment>
  )
}

export default UserType;
